import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="navbar navbar-expand-md navbar-light bg-light">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/">Your Brand</Link>

        <button 
          className="navbar-toggler" 
          type="button" 
          onClick={toggleNavbar}
          aria-expanded={isOpen ? "true" : "false"}
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className={`collapse navbar-collapse ${isOpen ? 'show' : ''}`} id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link className="nav-link" to="/" onClick={() => setIsOpen(false)}>Home</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/add-reservation" onClick={() => setIsOpen(false)}>Add Reservation</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/account" onClick={() => setIsOpen(false)}>Account</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/settings" onClick={() => setIsOpen(false)}>Settings</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-danger" to="/logout" onClick={() => setIsOpen(false)}>Log Out</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
